import Vue from 'vue'
import Router from 'vue-router'
import Layout from '@/layout/Layout.vue'
import Login from '@'
Vue.use(Router)

export default new Router({
  routes: [
   {
      path:'/',
      name:'Layout',
      component:Layout
    },
    {
      path:'/login',
      component:'Login',
      component: ()=> import("@/views/Login")
    },

  ]
})
